import React from 'react';
import { Container,Row,Col,Button} from 'react-bootstrap'
import './LandingPage.css'
import bg from './bg3.jpg';

const LandingPage = () =>{
    return(
        <Container>
            <Row>
                <Col className="justify-content-md-center">
                    <Row className="row1">Welcome to</Row>
                    <Row className="row2">Connect for a Cause</Row>
                    <Row className="row2"><button>REGISTER</button></Row>
                    <Row className="row2"><button>LOGIN</button></Row>
                </Col>
                <Col className="image"><img src={bg}/></Col>
            </Row>
        </Container>      
    )
}

export default LandingPage;
